def extract_sublist_members(lst, index):
    return [item[index] for item in lst]


def insert_sublist_members(lst1, lst2, index):
    working_list_1 = lst1
    working_list_2 = lst2
    for_index = 0
    for member in lst1:
        member[index] = working_list_2[for_index]
        for_index += 1
    return working_list_1


